import React from 'react';

function DevsPage() {
  return (
    <div style={{
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height: '100vh',
      textAlign: 'center',
      width: '100vw', // Garante que a largura seja 100% da viewport
    }}>
      <div>
        <h1>Desenvolvedores do Sistema</h1>
        <p>João Paulo Ferreira da Silva – RA: 10482315304</p>
        <p>Vitor Medeiros Carriel – RA: 10482313972</p>
      </div>
    </div>
  );
}

export default DevsPage;
